import React from 'react';

function TodoItem(props) {
    return(
        <div className='todo-item' style={{display: props.user.input ? "block" : "none"}}>
            <input type="checkbox"></input>
            <span>{props.input}</span>
        </div>
    )
};

export default TodoItem;
